import React, { useState, useEffect } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import UserService from "../../service/UserService";
import {
  Button,
  Card,
  CardActionArea,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";

const MovieList = () => {
  const [movies, setMovies] = useState([]);
  const [profileInfo, setProfileInfo] = useState({});
  const token = localStorage.getItem("token");

  useEffect(() => {
    fetchProfileInfo();
    fetchMovies();
  }, []);

  const fetchProfileInfo = async () => {
    try {
      const response = await UserService.getYourProfile(token);
      setProfileInfo(response.ourUsers);
    } catch (error) {
      console.error("Error fetching profile information:", error);
    }
  };

  const fetchMovies = async () => {
    try {
      const response = await axios.get("http://localhost:8081/api/movies", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setMovies(response.data);
      console.log(response.data);
    } catch (error) {
      console.error("Error fetching movies:", error);
    }
  };

  const deleteMovie = async (movieId) => {
    try {
      const confirmDelete = window.confirm(
        "Are you sure you want to delete this movie?"
      );
      if (confirmDelete) {
        await axios.delete(`http://localhost:8081/api/movie/${movieId}`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        fetchMovies(); // Refresh movie list after deletion
      }
    } catch (error) {
      console.error(`Error deleting movie ${movieId}:`, error);
    }
  };

  return (
    <div>
      <h1>Movies List</h1>
      {profileInfo.role === "ADMIN" && (
        <Button variant="contained" color="primary">
          <Link to="/add-movie" style={{ textDecoration: "none", color: "white" }}>
            Add Movie
          </Link>
        </Button>
      )}
      <div style={{ display: "flex", flexWrap: "wrap", gap: "16px" }}>
        {movies.map((movie) => (
          <Card key={movie.id} sx={{ maxWidth: 345, margin: "16px" }}>
            <CardActionArea>
              <CardMedia
                component="img"
                height="140"
                image={movie.image}
                alt={movie.title}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="div">
                  {movie.title}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {movie.director} - {movie.year}
                </Typography>
              </CardContent>
            </CardActionArea>
            <CardActions>
              {profileInfo.role === "ADMIN" && (
                <>
                  <Button
                    size="small"
                    color="primary"
                    onClick={() => deleteMovie(movie.id)}
                  >
                    Delete
                  </Button>
                  <Button size="small" color="primary">
                    <Link
                      to={`/update-movie/${movie.id}`}
                      style={{ textDecoration: "none", color: "inherit" }}
                    >
                      Update
                    </Link>
                  </Button>
                </>
              )}
              <Button size="small" color="primary">
                <Link
                  to={`/add-review/${movie.id}`}
                  style={{ textDecoration: "none", color: "inherit" }}
                >
                  Add Review
                </Link>
              </Button>
              <Button size="small" color="primary">
                <Link
                  to={`/view-movie/${movie.id}`}
                  style={{ textDecoration: "none", color: "inherit" }}
                >
                  View Reviews
                </Link>
              </Button>
            </CardActions>
          </Card>
        ))}
      </div>
    </div>
  );
};

export default MovieList;
